
function getName() {
    var minm = 10000000000; 
    var maxm = 99999999999; 
    let n = Math.floor(Math 
    .random() * (maxm - minm + 1)) + minm; 
    let name= "T"+n; 
    try {
     document.getElementById("search").value= name;
    }
    catch(err) {
    }
    return name;
}

function createSVG() {
    let name= getName();
    let s= Math.floor(Math.random()* (currencies.length));
    let done= false;
    let c= currencies[s];

    let volume=1000000+ Math.floor(10000000*Math.random());

    s= Math.floor(Math.random()* (markets.length));
    let m= markets[s];
     
    let content= new Array();
    content[0]= "ID        VOLUME      CODE        NUM     D      MIC";
    content[1]=  "----------------------------------------------------------------";
    content[2]=  name+"\t"+volume+"\t"+c.code+"\t"+c.num+"\t"+c.D+"\t"+m.mic
    content[3]=  "----------------------------------------------------------------";
    content[4]=  "MARKET: "+m.marketname;
    content[5]=  "----------------------------------------------------------------";   
    content[6]=  "DATE: "+new Date().toUTCString();
    content[7]=  "----------------------------------------------------------------";
    let desc= "name=\""+name+"\"";
    let ret = `<svg style="background-color: #FFFFFF" width="1024" height="1024"  xmlns="http://www.w3.org/2000/svg">
    <desc>`+ desc + `</desc>`+"\n"

    ret+=`
    <style>
    .small {
      font: italic 13px sans-serif;
    }
    .heavy {
        font: italic 36px serif;
        fill: black;
  
    }

    /* Note that the color of the text is set with the    *
     * fill property, the color property is for HTML only */
    .big {
      font: italic 24px serif;
      fill: black;
    }
    </style>`;
    for(let i= 0; i< content.length; i++) {
        ret+= '<text x="16" y="'+(128+32*i)+'" class="big">'+content[i]+'</text>';
    }
  
    ret+= "</svg>";
    return ret;
}

